import React from "react";
import Navbar from "./Navbar";

export const HomePage = () => {
  return (
    <section id='home' >
    <div className="home-wrapper" id='home'>
      <div className="home-wrapper__navbar">
        <div className='home-wrapper__navbar__container'>
          <Navbar />
        </div>
      </div>
      <div className="home-layout__box">
        <span className="home-wrapper__title">Hello!</span>
        <p className="home-wrapper__para">I'm a Web Developer</p>
        <p className="home-wrapper__para">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
          eiusmod tempor incididunt ut labore et dolore magna aliqua.
        </p>
      </div>
    </div>
    </section>
  );
};

export default HomePage;
